import React, { Component} from 'react';
import Navigation from './Navigation.js';
import './App.css';



class Homepage extends Component{
  render(){
    return(
      <div>
        <div class="homepage_image" >
          <h1>ברוכים הבאים</h1>
          <h1> למזון שפיים</h1>

        </div>
        <br></br>
        <br></br>
        <br></br>

        <div>
          הודעות חדשות
        </div>
      </div>

    );
    }
  }

class App extends Component{
  render (){
    return(
      <div>
        <div>
          <Navigation></Navigation>
        </div>
        <div>
          <Homepage></Homepage>
        </div>
    </div>
    )
  }
}

export default App;
